import React from 'react';

function CommandButton({ label, imgSrc, altText, bgColor = "bg-blue-500", textColor = "text-white" }) {
  return (
    <button className={`flex gap-2 justify-center px-3 py-2 ${bgColor} ${textColor} rounded-xl`}>
      <img loading="lazy" src={imgSrc} alt={altText} className="shrink-0 my-auto w-4 aspect-square" />
      <span>{label}</span>
    </button>
  );
}

export default CommandButton;
